import React from "react";

export default function InputComponent(props) {
    return (
        <label htmlFor={props.id}>
            <div className="info">{props.description}</div>
            <input
                id={props.id}
                type={props.type}
                placeholder={props.placeholder}
            />
        </label>
    );
}
